import React from 'react'
import './SideBar.css'

class SideBar extends React.Component{    

    render(){
        return (
            <div class="Sidebar">
                <img src="" alt="Profile Picture" />
                <h3>Email</h3>
                <p>UserName</p>
            </div>
        )
    }
}

export default SideBar
